import React from 'react'
import Person from './Person'
import Button from './Button';

const Persons = ({ persons }) => {
  return (
    <div>
      {persons.map(person =>
        <Person key={person.name} name={person.name} number={person.number} />)}
        <Button />
    </div>

  )
};

export default Persons;
